//Writer : Nikita
void poll_mouse_and_draw_cursor() {
	//Set up some vars

	volatile int *ps2_mouse_data_ptr = (int *)PS2_DUAL_BASE;
	int ps2_mouse_data = *ps2_mouse_data_ptr;
	int RVALID;
	int RAVAIL;
	
	RVALID = ps2_mouse_data & 0x8000;
	
	
	
	while (RVALID) {
		
		mouse_entries_read++;
		//printf("Mouse entries read is : %d \n", mouse_entries_read);
		
		//Shift the bytes over
		data_byte = x_diff_byte;
		x_diff_byte = y_diff_byte;
		
		//Read in the first byte
		y_diff_byte = ps2_mouse_data & 0xFF;

		if (mouse_entries_read == 30) {
			
			mouse_entries_read = 0;

			//Delete old cursor
			draw_box(cursor_old_position.x, cursor_old_position.y, 5, BLACK);
			
			int xdiff = 0;
			int ydiff = 0;

			cursor_old_position.x = cursor_position.x;
			cursor_old_position.y = cursor_position.y;

			if ((data_byte & 0x10) == 0x10) {
				xdiff += 256 - x_diff_byte + 1;
			} else if (x_diff_byte > 0) {
				xdiff += x_diff_byte;
			}

			if ((data_byte & 0x20) == 0x20) {
				ydiff += 256 - y_diff_byte + 1;
			} else if (y_diff_byte > 0) {
				ydiff += y_diff_byte;
			}

			//printf("x_diff_byte : %x, y_diff_byte : %x \n", x_diff_byte, y_diff_byte);
			//printf("Xdiff : %d, ydiff : %d \n", xdiff, ydiff);
			//Calculate new position
			//Only update the position if it's within bounds
			if (((cursor_position.x + xdiff) < 320) && ((cursor_position.x + xdiff) > 0)) {
				cursor_position.x = cursor_position.x + xdiff;
			}

			if (((cursor_position.y + ydiff) < 240) && ((cursor_position.y + ydiff) > 0)) {
				cursor_position.y = cursor_position.y + ydiff;
			}
			
			//printf("The y difference is : %d and the x difference is : %d \n", y_diff_byte, x_diff_byte);

			//Draw new cursor
			//printf("We are about to draw a box at <%d, %d> \n", cursor_position.x, cursor_position.y);
			draw_box(cursor_position.x, cursor_position.y, 5, RED);
		
			//Now call wait for vsync to line up with VGA buffer.
			wait_for_vsync();
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		
		}
		
		ps2_mouse_data = *ps2_mouse_data_ptr;
		RVALID = ps2_mouse_data & 0x8000;
		RAVAIL = ps2_mouse_data & 0xFFFF0000;
	}
	
	
}


/* Input is processed into tokens and then we use stacks and queues to represent BEDMAS. This function removes a token from that stack/queue */
//Writer : Kartikey
void removeToken (struct token** initial) {
	struct token *placeHolder = *initial;
	while ( placeHolder ) {
		placeHolder = (*placeHolder).next;
		free(*initial);
		*initial = placeHolder;
	}
}

//Writer : Nikita
bool read_one_char() {
	volatile int *ps2_data_ptr = (int *)PS2_BASE;
	int ps2_func_data = *ps2_data_ptr; //Here we actually read the data buffer
	int RVALID;
	bool successful_read = false;
	
	RVALID = ps2_func_data & 0x8000;
	
	if (RVALID) {
		char entry = ps2_func_data & 0xFF;
		
		if (skip_next_entry) {
			skip_next_entry = false;
			return false;
		}
		
		if (entry == 0xF0) {
			skip_next_entry = true;
			return false;
		}

		if (entry == 0xE0) {
			read_one_char();
			return true;
		}
		
		//Check if the entry is valid AND it's not a repeated key
		if (entry != 0xF0) {
			
			//Means user has pressed left-shift
			//Need to convert to appropriate upper-case version
			if (entry == 0x12) {
				new_keyboard_entry = false;
				while (new_keyboard_entry == false) {
					read_one_char();
				}
				
				if (most_recent_keyboard_entry == '9') {
					most_recent_keyboard_entry = '(';
					new_keyboard_entry = true;
					return true;
					
				} else if (most_recent_keyboard_entry == '0') {
					most_recent_keyboard_entry = ')';
					new_keyboard_entry = true;
					return true;
					
				} else if (most_recent_keyboard_entry == '6') {
					most_recent_keyboard_entry = '^';
					new_keyboard_entry = true;
					return true;
					
				} else if (most_recent_keyboard_entry == '=') {
					most_recent_keyboard_entry = '+';
					new_keyboard_entry = true;
					return true;
					
				} else if (most_recent_keyboard_entry == '8') {
					most_recent_keyboard_entry = '*';
					new_keyboard_entry = true;
					return true;
					
				} else {
					most_recent_keyboard_entry = toupper(most_recent_keyboard_entry);
					new_keyboard_entry = true;
					return true;
				}
			//Means user has not pressed shift, so we just return ASCII equivalent
			} else {
				most_recent_keyboard_entry = ASCIITable[(int)entry];
				new_keyboard_entry = true;
				return true;
			}
		}
	} else {
		//printf("*ERROR* \n There's nothing to read off of the PS2 data register!"); 
		new_keyboard_entry = false;
	}
	
	return successful_read;	
}

//Writer : Nikita
void read_line_of_text() {
	
	new_keyboard_entry = true;
	
	most_recent_keyboard_line_entry = "";
	
	//This will repeat until the RVALID bit is set to 0, i.e we get to the end
	while (new_keyboard_entry) {
		if (read_one_char()) {
			//printf("You just entered : %c \n", most_recent_keyboard_entry);
			append(most_recent_keyboard_line_entry, most_recent_keyboard_entry);
		}
	}

	return;
	
}

