//Writer : Nikita
void video_text(int x, int y, char * text_ptr) {
	int offset;
	/* assume that the text string fits on one line */
	offset = (y << 7) + x;
	while (*(text_ptr)) {
		*(char *)(char_buffer_start + offset) = *(text_ptr); // write to the character buffer
		++text_ptr; //Move along the char pointer
		++offset; //This will increase the x coordinate so it get's placed to the right of it
	}
}

