//Writer : Nikita
void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	int status;
	*pixel_ctrl_ptr = 1; //Tell VGA controller we're ready to draw
	status = *(pixel_ctrl_ptr + 3); //Retrieve status bit
	
	//Check if the status bit has gone to 0, otherwise loop
	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
	
}

