//Writer : Nikita
void convert_input_to_internal_model() {
	
	bool detectedSine = false;
	bool detectedCosine = false;
	bool detectedTangent = false;
	bool detectedLn = false;
	bool detectedLog = false;

	//Need to clear the old internal model
	for (int i = 0; i < strlen(internal_current_calculator_input); i++) {
		internal_current_calculator_input[i] = '\0';
	}

	//Here we interpret on a character by character basis
	for (int i = 0; i < strlen(current_calculator_input); i++) {

		float waveResult = 0;
		char waveInput[MAXIMUMLENGHT] = {'\0'};
		char waveOutput[MAXIMUMLENGHT] = {'\0'};


		if (detectedSine || detectedCosine || detectedTangent || detectedLn || detectedLog) {
			//Starts off as a '(' then is whatever comes next
			char current_char = current_calculator_input[i];

			if (current_char == '(') {
				append(internal_current_calculator_input, '(');
				continue;
			}
			
			while(current_char != ')') {

				if (current_char == 'p') {
					append(waveInput, '3');
					append(waveInput, '.');
					append(waveInput, '1');
					append(waveInput, '4');
					append(waveInput, '1');
					append(waveInput, '5');
					append(waveInput, '9');
				} else {
					append(waveInput, current_calculator_input[i]);
				}
				i++;
				current_char = current_calculator_input[i];
			}

			waveResult = calculate(waveInput);

			if (detectedSine) {
				waveResult = sin(waveResult);
			} else if (detectedCosine) {
				waveResult = cos(waveResult);
			} else if (detectedTangent) {
				waveResult = tan(waveResult);
			} else if (detectedLn) {
				waveResult = log(waveResult);
			} else if (detectedLog) {
				waveResult = log10(waveResult);
			}
			

			gcvt(waveResult, 6, waveOutput);
			//printf("The wave result is : %s\n", waveOutput);

			for (int j = 0; j < strlen(waveOutput); j++) {
				append(internal_current_calculator_input, waveOutput[j]);
			}

			append(internal_current_calculator_input, ')');

			//printf("We are going to put this into the interal value : %s\n", internal_current_calculator_input);

			detectedSine = false;
			detectedCosine = false;
			detectedTangent = false;
			detectedLn = false;
			detectedLog = false;
			continue;
		}

		if (current_calculator_input[i] == 'p') {
			append(internal_current_calculator_input, '3');
			append(internal_current_calculator_input, '.');
			append(internal_current_calculator_input, '1');
			append(internal_current_calculator_input, '4');
			append(internal_current_calculator_input, '1');
			append(internal_current_calculator_input, '5');
			append(internal_current_calculator_input, '9');
		}

		else if (current_calculator_input[i] == 'A') {
			gcvt(most_recent_calculation_result, 8, internal_current_calculator_input);

		}
		
		else if (current_calculator_input[i] == 'e') {
			append(internal_current_calculator_input, '2');
			append(internal_current_calculator_input, '.');
			append(internal_current_calculator_input, '7');
			append(internal_current_calculator_input, '1');
			append(internal_current_calculator_input, '8');
			append(internal_current_calculator_input, '2');
			append(internal_current_calculator_input, '8');

		} else if (current_calculator_input[i] == 's' || current_calculator_input[i] == 'c' || current_calculator_input[i] == 't' || current_calculator_input[i] == 'n' || current_calculator_input[i] == 'm') {
			detectedSine = (current_calculator_input[i] == 's');
			detectedCosine = (current_calculator_input[i] == 'c');
			detectedTangent = (current_calculator_input[i] == 't');
			detectedLn = (current_calculator_input[i] == 'n');
			detectedLog = (current_calculator_input[i] == 'm');

		} else {
			append(internal_current_calculator_input, current_calculator_input[i]);
		}
	}
}

//Writer : Nikita
void draw_current_calculator_input() {
	char * current_char;
	char input[MAXIMUMLENGHT];
	char error_msg[6] = {'E', 'R', 'R', 'O', 'R', '\0'};

	if (inputError == true) {
		strcpy(input, error_msg);
		inputError = false;
	} else {
		strcpy(input, current_calculator_input);
	}

	int length_of_input = strlen(input);

	if (draw_offset > length_of_input) {
		current_char = input;
	} else {
		current_char = input + length_of_input - draw_offset;
	}

	while (current_char != input) {
		draw_char_on_calculator_screen(*current_char);
		current_char--;
	}

	draw_char_on_calculator_screen(*input);
}

